import React, {useState,useEffect} from 'react';
import * as Actions from "../actions";
import {connect} from 'react-redux';
import {Dashboard,Topbar,Categories} from '../containers';
import {getProfileUser} from "../tools/handleRequests"


const DashboardRoute = ({user,auth}) => {
    useEffect(() => {
        async function teste(){
            const {country,id} = await getProfileUser(auth.accessToken).then(res => res.data)
            console.log(id);
        }
        teste()
    }, [])
    return (
        <Dashboard>
            <Topbar></Topbar>
            <Categories></Categories>
        </Dashboard>
    )
}
export default connect(state => ({user: state.user, auth: state.auth}))(DashboardRoute)
